import Component4 from "./comp4";

const Component3 = (props) => {
  console.log("props of Component 3", props);

  //Destructing
  const { nameprop, ageprop } = props;
  console.log("nameprop and ageprop of Component 3", nameprop, ageprop);

  return (
    <div>
      <h4>Component 3</h4>
      <Component4 nameprop={nameprop} ageprop={ageprop} />
    </div>
  );
};
export default Component3;
